import React from 'react'

function LoginScreen() {

  const [username, setUsername] = useState([]);
  const [password, setPassword] = useState([]);

  function logIn(){
    const admin={
      username,
      password
    }
  }

  return (
    <div>
        <div className='row justify-content-center mt-5'>
          <div>
            <div>
              <h1>LOG-IN</h1>
              <p>*Here you can log-in just if you are an admin*</p>
              <input type="text" className='form-control mt-1 inputstyling' placeholder='username'
              value={username} onChange={(e) => {setUsername(e.target.value)}}/>
              <textarea type="text" className='form-control mt-1 inputstyling' placeholder='password' rows={4}
              value={password} onChange={(e) => {setPassword(e.target.value)}}/>

              <button className='btn btn-primary' onClick={logIn}>Log-in</button>
            </div>
          </div> 
        </div>
    </div> 
  )
}

export default LoginScreen
